import React, { useState } from 'react';
import { Link, useParams } from 'react-router-dom';

const OrderNow = () => {
    const [cart, setCart] = useState([]); // Initialize an empty cart
    const { restaurantName } = useParams();

    const restaurants = {
        'Sarovar Portico': {
            items: [
                { name: 'Butter Naan', price: 50, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRGk-LKmmf8Do_eFTsaqOrU3VFD2X87DgDjvw&usqp=CAU' },
                { name: 'Mix Veg', price: 110, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQUD95rTk5BhESm4y557G2JncSpHhljGADPzQ&usqp=CAU' }, 
                { name: 'Pizza', price: 350, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSr3UQ1WyKU87GaXiXozpFo5mc-tqvANrDGTw&usqp=CAU'},
                { name: 'Chowmein', price: 70, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRKN7E5nNju7MFg0AuJ4qVqCAar1KBb3kLhoA&usqp=CAU'},
                { name: 'Juice', price: 100, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT_ta1ybNoGNht6z0FnuRrKMPPDBgCD3jp4AQ&usqp=CAU'},
                { name: 'Salad', price: 65, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQgrpIA2W9ugcf0b6-n70IDRax0_ln3ChoCtg&usqp=CAU'},
            ],
        },
        'Radisson Blu': {
            items: [
                { name: 'Chicken', price: 320, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSivNJ8d4N_TvS02eVXPJie1vLilTUrSsrltA&usqp=CAU' },
                { name: 'Shahi Paneer', price: 220, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQKd9N93vE5cHbVgusvrwonDm1Yzgk8GP1y6A&usqp=CAU' },
                { name: 'Mix Veg', price: 110, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQUD95rTk5BhESm4y557G2JncSpHhljGADPzQ&usqp=CAU' }, 
            ],
        },
        'La Plage': {
            items: [
                { name: 'Butter Naan', price: 50, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRGk-LKmmf8Do_eFTsaqOrU3VFD2X87DgDjvw&usqp=CAU' },
                { name: 'Shahi Paneer', price: 220, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQKd9N93vE5cHbVgusvrwonDm1Yzgk8GP1y6A&usqp=CAU' },
                { name: 'Mix Veg', price: 110, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQUD95rTk5BhESm4y557G2JncSpHhljGADPzQ&usqp=CAU' }, 
            ],
        },
        'Sienna store and Cafe': {
            items: [
                { name: 'Butter Naan', price: 50, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRGk-LKmmf8Do_eFTsaqOrU3VFD2X87DgDjvw&usqp=CAU' },
                { name: 'Shahi Paneer', price: 220, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQKd9N93vE5cHbVgusvrwonDm1Yzgk8GP1y6A&usqp=CAU' },
                { name: 'Mix Veg', price: 110, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQUD95rTk5BhESm4y557G2JncSpHhljGADPzQ&usqp=CAU' }, 
            ],
        },
        'Americano': {
            items: [
                { name: 'Butter Naan', price: 50, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRGk-LKmmf8Do_eFTsaqOrU3VFD2X87DgDjvw&usqp=CAU' },
                { name: 'Shahi Paneer', price: 220, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQKd9N93vE5cHbVgusvrwonDm1Yzgk8GP1y6A&usqp=CAU' },
                { name: 'Mix Veg', price: 110, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQUD95rTk5BhESm4y557G2JncSpHhljGADPzQ&usqp=CAU' }, 
            ],
        },
        'Palms and Sand Beach': {
            items: [
                { name: 'Butter Naan', price: 50, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRGk-LKmmf8Do_eFTsaqOrU3VFD2X87DgDjvw&usqp=CAU' },
                { name: 'Shahi Paneer', price: 220, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQKd9N93vE5cHbVgusvrwonDm1Yzgk8GP1y6A&usqp=CAU' },
                { name: 'Mix Veg', price: 110, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQUD95rTk5BhESm4y557G2JncSpHhljGADPzQ&usqp=CAU' }, 
            ],
        }
    };


    // Function to add an item to the cart
    const addToCart = (item) => {
        setCart([...cart, item]);
    };

    return (
        <div className="container">
            <h2 className="pb-3 fs-4">{restaurantName}</h2>
            <div className="row row-cols-1 row-cols-md-3 g-4">
                {restaurants[restaurantName].items.map((item, index) => (
                    <div key={index} className="col">
                        <div className="card">
                            <img src={item.imageUrl} alt={item.name} className="card-img-top" style={{ width: '290px', height: '174px' }}/>
                            <div className="card-body">
                                <h5 className="card-title">{item.name}</h5>
                                <p className="card-text">&#8377;{item.price}</p>
                                <div className="card-button" style={{ position: 'absolute', bottom: '25px', right: '10px' }}>
                                    <button type="button"
                                        onClick={() => addToCart(item)}
                                        className="btn btn-link"
                                    >
                                        <Link to="/cart">Add to Cart</Link>
                                    </button>
                                </div>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>

    );
};

export default OrderNow;
